import { useState, useEffect } from "react";
import MasterMindRow from "./MasterMindRow";

const MasterMindGame = () => {
    const [randomNums, setRandomNums] = useState([]);

    useEffect(() => {
        // //1. retrieve random numbers from api
        fetch("https://www.random.org/integers/?num=4&min=0&max=7&col=1&base=10&format=plain&rnd=new")
        .then((res) => {
            return res.text()
        })
        .then((data) => {
            console.log(data);
            var array = data.split("\n")
            array.pop()
            array.map((num) => {
                return parseInt(num)
            })
            setRandomNums(array);
        })
        .catch(error => {
            console.log(error)
        })
    }, [])

